function mpohm_states_picker( $name, $val )
{
  $states = Membership::the_states();
  ?>

  <select name="">
    <?php foreach( $states as $ab => $state ) : ?>
      <option value="<?php echo $ab ?>"<?php if( $ab == $val ) echo ' selected' ?>><?php echo $ab ?></option>
    <?php endforeach ?>
  </select>

  <?php
}




function mpohm_login( $post )
{
  $mem = new Membership();
  $mem->login( $post );
}



add_action( 'wp_ajax_mpohm_action', 'mpohm_action' );
add_action( 'wp_ajax_nopriv_mpohm_action', 'mpohm_action' );

function mpohm_action()
{
	global $wpdb; // this is how you get access to the database

	// get the function name
	$func = $_POST['func'];

	// if the function doesn't exist, echo no function
	if( ! function_exists( $func ) )
	{
		echo 'no function';
		wp_die();
	}

	// execute the function
	$func( $_POST );

	wp_die(); // this is required to terminate immediately and return a proper response
}




